import React from 'react';
import Navbar from './Navbar';
import Header from './Header';
import Particles from 'react-particles-js';
import {makeStyles} from '@material-ui/core/styles'




const useStyles = makeStyles({
    particlesCanva:{
        position: 'absolute',
        opacity: '0.3'

    }

})

// here goes alla components.
//nedeed to install partcles
const Main = () => {

    const classes = useStyles();

    return (
        <>

            <Navbar/>
            <Header/>
            <Particles
            canvasClassName={classes.particlesCanva}
            params={{
            particles: {
                number:{
                value: 45,
                density:{
                    enable: true,
                    value_area: 800
                }
            },
            shape:{
                type: 'star',
                stroke: {
                    with: 0,
                    color: "#000000"

                }
            },
            size: {
                value: 3,
                random: true,
                animation: {
                    enable: true,
                    speed: 2,
                    size_min: 0.1,
                    sync:false
              }

            },
            opacity:{
                value: 0.4,
                random: true,
                animation:{
                    enable: true,
                    speed: 1,
                    opacity_min: 0.1,
                    sync: false

                }
            }

        }

          }}

          />


        </>
    );
}

export default Home;

